; Agilent signal generator configuration for N5173B or E8257D.

[include]
dbm_b6.ini = 

[agilent]
logname = AGILENT
pubname = AGILENT
;simulate = SIM_AGILENT
simulate =

; Network address
;ip = 10.100.40.100  ; Hilo
ip = 128.171.92.35
port = 5025

; This will be used as a safe power level when switching receivers
; or on tuning failure, and as a default value in simulate mode.
; -20 dBm is the minimum power output of the E8257D.
safe_dbm = -20

; This depends on whether we are connected directly to the harmonic mixer
; or going through an amplifier.
; direct:    use 14.5 dbm  (seems to be the actual output limit)
; amplified: use  0 dbm
max_dbm = 14.5

; Final system will use 4X harmonic, but in the lab we had
; trouble getting sufficient band 6 IF power using a PMP WM,
; so we were using 5X.
harmonic = 4

; First LO Offset Generator GHz.
; TODO this setting doesn't really belong here.
floog = 0.0315

; TODO: I keep having to rename these tables.
; Instead it'd be convenient to list the in-use table names.

; Testing band7 in the lab showed that power input to the harmonic mixers can
; drop off at higher frequencies, requiring extra power output from the signal
; generator to reach the needed ~7dBm.  Since each band has separate cabling,
; each band gets its own dBm lookup table, indexed by LO GHz.

[dbm_b3]
dbms=1
dbm01=77.000, -16.00

